<p>我知道，那时候对他来说很多事情都还充满着未知数：论文还没定稿、答辩还没启动、典礼还没举行、工作还没着落……对此我没有反驳。我说，你辛苦这四年，不就为了这一天么？他说，道理我都懂，可生活状态的改变对我而言无疑是道坎儿。我说，你不去试试你又怎么知道。他说，没说我不试试……然后巴拉巴拉讲一堆。至此我不难得出“朋友是个处女座”的结论，反正我觉得没什么好担心的，也许一个月总有那么几天呢。</p>
